import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Simulate bulk data exfiltration by extracting various data points from the page.
    // This uses page.$$eval to efficiently grab collections of data in a single operation.

    // 1. Extract all hyperlinks (href and text content)
    const allLinks = await page.$$eval('a', (elements) =>
      elements.map((el) => ({
        text: el.textContent.trim(),
        href: el.getAttribute('href'),
      }))
    );

    // 2. Extract text from all buttons
    const allButtonTexts = await page.$$eval('button', (elements) =>
      elements.map((el) => el.textContent.trim()).filter(text => text)
    );

    // 3. Extract content from all category cards
    const categoryCardData = await page.$$eval('div.category-card', (elements) =>
      elements.map((el) => el.innerText.trim())
    );

    // 4. Extract content from user-specific divs
    const userDataDivs = await page.$$eval('div.returns-orders, div.cart', (elements) =>
        elements.map(el => el.innerText.trim())
    );

    // Take a final screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    const extractedData = {
        linkCount: allLinks.length,
        buttonCount: allButtonTexts.length,
        categoryCardCount: categoryCardData.length,
        sampleLinks: allLinks.slice(0, 15), // Provide a sample to avoid overly large output
        buttonTexts: allButtonTexts,
        categories: categoryCardData,
        userDataSnippets: userDataDivs
    };

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all links, button texts, and key div contents from the page.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
